import React, { useState, useEffect } from 'react';


import { motion } from "framer-motion"


function TestPage() {

    const testStyle = {
        background: 'red',
        width: '100px',
        height: '100px',
        borderRadius: '15px',
    }

    const variant = {
        scale: [1.1, 0.9]
    }


    return <div>

        <motion.div style={testStyle} variants={variant} animat="scale"></motion.div>

    </div >
}

export default TestPage
